import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Navbar() {
  const navigate = useNavigate();
  const token = localStorage.getItem("token");
  const user = JSON.parse(localStorage.getItem("user") || "{}");
  const [menuOpen, setMenuOpen] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    navigate("/login");
  };

  return (
    <nav style={styles.navbar}>
      <div style={styles.container}>
        {/* Logo Section */}
        <Link to="/" style={styles.logo}>
          <img src="/logo.png" alt="Logo" style={styles.logoImg} />
          <span>JobFinder</span>
        </Link>

        {/* Mobile Menu Toggle */}
        <button
          onClick={() => setMenuOpen(!menuOpen)}
          style={styles.menuButton}
        >
          {menuOpen ? (
            <span style={{ fontSize: "22px" }}>âœ–</span>
          ) : (
            <span style={{ fontSize: "22px" }}>â˜°</span>
          )}
        </button>

        {/* Links */}
        <div
          style={{
            ...styles.linkContainer,
            display: menuOpen ? "block" : "none",
          }}
        >
          <ul style={styles.ul}>
            <li>
              <Link to="/jobs" style={styles.link}>
                Jobs
              </Link>
            </li>

            {token ? (
              <>
                <li>
                  <Link to="/dashboard" style={styles.link}>
                    Dashboard
                  </Link>
                </li>

                <li style={styles.profileWrapper}>
                  <button style={styles.profileButton}>
                    {user?.name || "Profile"}
                  </button>
                  <div style={styles.dropdown}>
                    <Link to="/profile" style={styles.dropdownItem}>
                      My Profile
                    </Link>
                    <button
                      onClick={handleLogout}
                      style={{ ...styles.dropdownItem, borderTop: "1px solid #555" }}
                    >
                      Logout
                    </button>
                  </div>
                </li>
              </>
            ) : (
              <>
                <li>
                  <Link to="/login" style={styles.link}>
                    Login
                  </Link>
                </li>
                <li>
                  <Link to="/register" style={styles.registerBtn}>
                    Register
                  </Link>
                </li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}

/* ðŸŽ¨ Inline Styles */
const styles = {
  navbar: {
    background: "#6b3fa0",
    color: "#fff",
    width: "100%",
    boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
    position: "sticky",
    top: 0,
    zIndex: 1000,
  },
  container: {
    maxWidth: "1200px",
    margin: "0 auto",
    padding: "12px 20px",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  },
  logo: {
    display: "flex",
    alignItems: "center",
    gap: "8px",
    textDecoration: "none",
    color: "#fff",
    fontSize: "20px",
    fontWeight: "600",
  },
  logoImg: { width: "35px", height: "35px" },
  menuButton: {
    background: "none",
    border: "none",
    color: "#fff",
    cursor: "pointer",
    fontSize: "22px",
    display: "none",
  },
  linkContainer: {
    width: "auto",
  },
  ul: {
    listStyle: "none",
    display: "flex",
    alignItems: "center",
    gap: "18px",
    margin: 0,
    padding: 0,
  },
  link: {
    color: "#fff",
    textDecoration: "none",
    padding: "6px 10px",
    borderRadius: "6px",
    transition: "0.2s",
  },
  registerBtn: {
    background: "#fff",
    color: "#6b3fa0",
    textDecoration: "none",
    padding: "8px 14px",
    borderRadius: "8px",
    fontWeight: "bold",
  },
  profileWrapper: {
    position: "relative",
  },
  profileButton: {
    background: "none",
    border: "none",
    color: "#fff",
    cursor: "pointer",
    padding: "6px 10px",
    fontSize: "15px",
  },
  dropdown: {
    display: "none",
    position: "absolute",
    right: 0,
    top: "35px",
    background: "#5b2e91",
    borderRadius: "8px",
    boxShadow: "0px 4px 6px rgba(0,0,0,0.2)",
    overflow: "hidden",
  },
  dropdownItem: {
    display: "block",
    width: "100%",
    textAlign: "left",
    background: "none",
    border: "none",
    color: "#fff",
    textDecoration: "none",
    padding: "10px 14px",
    cursor: "pointer",
  },
};

/* Hover Logic */
styles.profileWrapper[':hover'] = {
  ...styles.profileWrapper,
  dropdown: { display: "block" },
};
